Parameters for the W3C Recommendation: 
<a href="http://www.w3.org/TR/xml-exc-c14n/"> Exclusive XML Canonicalization (C14N) algorithm</a>. The parameters include an optional inclusive namespace prefix list. The XML Schema Definition of the Exclusive XML Canonicalization parameters is defined as: 
<pre><code>
 &lt;schema xmlns="http://www.w3.org/2001/XMLSchema"
         xmlns:ec="http://www.w3.org/2001/10/xml-exc-c14n#"
         targetNamespace="http://www.w3.org/2001/10/xml-exc-c14n#"
         version="0.1" elementFormDefault="qualified"&gt;

 &lt;element name="InclusiveNamespaces" type="ec:InclusiveNamespaces"/&gt;
 &lt;complexType name="InclusiveNamespaces"&gt;
   &lt;attribute name="PrefixList" type="xsd:string"/&gt;
 &lt;/complexType&gt;
 &lt;/schema&gt;
 </code></pre>
